public ContainerId getContainerId() {
  SignalContainerRequestProtoOrBuilder p = viaProto ? proto : builder;
  if (this.containerId != null) {
    return this.containerId;
  }
  if (!p.hasContainerId()) {
    return null;
  }
  this.containerId = convertFromProtoFormat(p.getContainerId());
  return this.containerId;
}
